import React, { useState, useContext, useEffect } from "react";
import { Link } from "react-router-dom";
import HomebtImg from "../../assets/homebotton.png";
//import Subtract from "../../assets/Subtract.png";
import OneSubtract from "../../assets/OneSubtract.png";
import Pizzabanana1 from "../../assets/pizzabanana1.png";
import Plus from "../../assets/Plus.png";
import delect from "../../assets/delect.png";
import "./Check.css";
import { ModelContext } from "../../Context/ModelContext";
import { addToCart, removeFromCart } from "../../actions/cartAction";

import { useSelector, useDispatch } from "react-redux";

const Check = (props) => {
  const cart = useSelector((state) => state.cart);

  const { cartItems } = cart;
  const [count, setCount] = useState(1);

  const { setCurrentModel } = useContext(ModelContext);
  const openModel = () => setCurrentModel({ name: "CheckModal" });

  const productId = props.match.params.id;
  const qty = props.location.search
    ? Number(props.location.search.split("=")[1])
    : 1;

  const dispatch = useDispatch();
  const removeFromCartHandler = (productId) => {
    dispatch(removeFromCart(productId));
  };

  const update = (action) => {
    if (action === "increment") {
      setCount(count + 1);
    }
    if (action === "decrement") {
      setCount(count - 1);
    }
  };

  useEffect(() => {
    if (productId) {
      dispatch(addToCart(productId, qty));
    }
  }, []);

  return (
    <div className="Check">
      <div className="Check_main">
        <div className="TopCheck">
          <h1 className="titlechecks"> Seu pedido </h1>
          <Link className="return" to="/">
            <img src={HomebtImg} className="" alt="logo" />
          </Link>
        </div>
      </div>

      <div className="check_main">
        {cartItems.length === 0 ? (
          <div>Cart is empty</div>
        ) : (
          cartItems.map((item) => (
            <div key={item._id} className="onepizzabox">
              <div className="pizzanameandprice">
                <img
                  src={
                    process.env.PUBLIC_URL +
                    `/assets/${item.category}/${item.image}`
                  }
                  alt="Pizza"
                />
                <div className="pizzanameandpricemain">
                  <h2>{item.sabor}</h2>
                  <h3>{item.price}$R</h3>
                </div>
              </div>

              <p className="pizzaItemsSelect">
                Banana ,Açúcar ,Muçarela, Banana , Açúcar ,Muçarela Banana
                ,Açúcar ,Muçarela, Banana , Açúcar ,Muçarela
              </p>

              <button
                onClick={() => {
                  if (count > 1) {
                    update("decrement");
                  }
                }}
                type="button"
                className="btn btn-secondary"
              >
                <img src={OneSubtract} alt="" />
              </button>
              <h1 className="TotalPizzaSelects">{count}</h1>

              <button
                onClick={() => {
                  update("increment");
                }}
                type="button"
                className="btn btn-secondary"
              >
                <img src={Plus} alt="plus" />
              </button>
              <button onClick={() => removeFromCartHandler(item.product)}>
                <img src={delect} alt="delect" />
              </button>
            </div>
          ))
        )}
      </div>

      <div className="check_Reorder">
        <Link className="Reorder" to="/select">
          <h1>ADICIONAR OUTRA PIZZA</h1>
        </Link>
        <Link onClick={openModel} className="Checkvalid">
          <h1>FINALIZAR PEDIDO</h1>
        </Link>
      </div>

      <div className="check_footer">
        <h1 className="TotalPrice">VALOR TOTAL : 24 $R</h1>

        <h1 className="TotalPizza">PIZZA : {count} </h1>
      </div>
    </div>
  );
};

export default Check;
